import { StatusBar } from "expo-status-bar";
import { Button, StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AuthLogin from "./components/admin/AuthLogin";
import Rooms from "./components/admin/Rooms";
import Client from "./components/Client";

const Stack = createNativeStackNavigator();

const Welcome = ({ navigation }) => {
	return (
		<View>
			<Text>Choose a Room</Text>
			<Button
				title="Room 1"
				onPress={() => {
					/* 1. Navigate to the Details route with params */
					navigation.navigate("Client", {
						itemId: 86,
						otherParam: "anything you want here",
					});
				}}
			/>
		</View>
	);
};

export default function App() {
	return (
		<NavigationContainer>
			<Stack.Navigator>
				<Stack.Screen name="/" component={Welcome} options={{ title: "Welcome" }} />
				<Stack.Screen name="/room" component={Client} options={{ title: "Welcome" }} />
				<Stack.Screen name="/admin" component={Rooms} options={{ title: "Rooms Admin" }} />
				<Stack.Screen name="/login" component={AuthLogin} />
			</Stack.Navigator>
		</NavigationContainer>

		// <View style={styles.container}>
		// 	<Text>Open up App.js to start working on your app!</Text>
		// 	<StatusBar style="auto" />
		// </View>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
		alignItems: "center",
		justifyContent: "center",
	},
});
